import axios from "axios";

const apiKey = "a8ce1029e7856b8a14e6b172318a0f31";

export const pochtaTest = async () => {
  try {
    const { data } = await axios.get("https://api.novaposhta.ua/v2.0/json/", {
      apiKey: apiKey,
      modelName: "Address",
      calledMethod: "searchSettelments",
      methodProperties: {
        AreaRef: "00000000-0000-0000-0000-000000000000",
        Ref: "00000000-0000-0000-0000-000000000000",
        RegionRef: "00000000-0000-0000-0000-000000000000",
        Page: "1",
        Warehouse: "1",
        FindByString: "Київ",
        Limit: "20",
      },
    });
    console.log(data);
  } catch (error) {
    console.error("Error fetching data:", error);
  }
};
